import React from "react";

import UserList from "../components/UserList";

const Users = () => {
  const USERS = [
    {
      id: "u1",
      name: "dhyey desai",
      image:
        "https://images.pexels.com/photos/9969639/pexels-photo-9969639.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500",
      places: "3",
    },
    {
      id: "u2",
      name: "priyansh desai",
      image:
        "https://images.pexels.com/photos/3641420/pexels-photo-3641420.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500",
      places: "2",
    },
    {
      id: "u3",
      name: "jenil kalathiya",
      image:
        "https://images.pexels.com/photos/3641420/pexels-photo-3641420.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500",
      places: "4",
    },
    {
      id: "u4",
      name: "krunal panchal",
      image:
        "https://images.unsplash.com/photo-1535713875002-d1d0cf377fde?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8dXNlciUyMHByb2ZpbGV8ZW58MHx8MHx8&auto=format&fit=crop&w=600&q=60",
      places: "2",
    },
  ];

  return <UserList items={USERS} />;
};

export default Users;
